import React, { useState, useEffect} from 'react'


function App() {
  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("/page1").then(
      // convert resonponse to json
      res=>res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div>
    </div>
  );
}

export default App;
